import React, {useState, useEffect} from 'react'
import axios from 'axios'
import {Link} from 'react-router-dom'

function Home() {
    const [data, setData] = useState([])
    useEffect(()=>{
        axios.get("/students")
        .then((res)=>{
            setData(res.data)
        })
        .catch((err)=>console.log(err))
    })
    return (
        <table className="table table-striped">
            <thead>
                <tr>
                    <th>No.</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Age</th>
                    <th>Gender</th>
                    <th>Action</th>
                </tr>
            </thead>
            <tbody>
                {data.map((student, index) => {
                    return (
                        <tr key={ student.id }>
                            <td>{ index + 1 }</td>
                            <td>{ student.name }</td>
                            <td>{ student.email }</td>
                            <td>{ student.age }</td>
                            <td>{ student.gender }</td>
                            <td>
                                <Link to={`/Read/${student.id}`}/>Detail
                                <button className='btn btn-sm btn-danger'>Hapus</button>
                            </td>
                        </tr>
                    )
                })}
            </tbody>
        </table>
    )
}

export default Home
